import React from 'react';
import { useTranslation } from "react-i18next";
import Layout from './Components/layout';

const Contacts = () => {
  const { t } = useTranslation();
  return (
    <Layout>
      <div className="contacts">

        <div className="contacts-hero">
          <div className="big-title-Book" > {t("contacts-contacts-title")}</div>
        </div>

        <div className="row">
          <div className="contacts-info col-xs-3">

            <div className="text">{t("contacts-info-title-1")}</div>
            <div className="text-note">{t("contacts-info-adress-1")}</div>

            <div className="text">{t("contacts-info-title-2")}</div>
            <div className="text-note">{t("contacts-info-adress-2")}</div>

            <div className="text">{t("contacts-info-title-3")}</div>
            <div className="text-note">{t("contacts-info-adress-3")}</div>
          </div>

          <div className="contacts-form col-xs-offset-2 col-xs-3">

            <div className="field text-note">{t("contacts-info-name")}</div>

          </div>

          <div className="contacts-form col-xs-offset-1 col-xs-3">

            <div className="field text-note">{t("contacts-info-email")}</div>

          </div>
        </div>

      </div>
    </Layout>
  );
};

export default Contacts;
